import React from 'react';

function ExportButtons({ exportToCSV, exportToExcel }) {
    return (
        <div>
            <button onClick={exportToCSV} style={{ marginRight: '10px', padding: '10px 20px' }}>
                Export CSV
            </button>
            <button onClick={exportToExcel} style={{ padding: '10px 20px' }}>
                Export Excel
            </button>
        </div>
    );
}

export default ExportButtons;
